import Checkbox from '@material-ui/core/Checkbox';
import { useState } from 'react'
import { withStyles } from '@material-ui/core/styles';
import { green } from '@material-ui/core/colors';

function CheckBoxGroup( props ) {

    
    //For the checkboxes
    const [state, setState] = useState({
        checkedA: true,
        checkedB: true,
        checkedF: true,
        checkedG: true,
      });

    const handleChange = (event) => {
        setState({ ...state, [event.target.name]: event.target.checked });
    };

    return (
        <div id="stats-checkbox-container">
            <div className="checkbox-label-container">
                <p className="checkbox-label">GKP</p>
                <GreenCheckbox checked={state.checkedA} onChange={handleChange} name="checkedA" id="GKP-CB" />
            </div>
            <div className="checkbox-label-container">
                <p className="checkbox-label">DEF</p>
                <GreenCheckbox checked={state.checkedB} onChange={handleChange} name="checkedB" id="DEF-CB" />
            </div>
            <div className="checkbox-label-container">
                <p className="checkbox-label">MID</p>
                <GreenCheckbox checked={state.checkedF} onChange={handleChange} name="checkedF" id="MID-CB" /> 
            </div>
            <div className="checkbox-label-container">
                <p className="checkbox-label">FWD</p>
                <GreenCheckbox checked={state.checkedG} onChange={handleChange} name="checkedG" id="FWD-CB" />
            </div>               
        </div>
    )
}

const GreenCheckbox = withStyles({
    root: {
      color: green[400],
      padding: '6px',
      '&$checked': {
        color: green[600],
      },
    },
    checked: {},
  })((props) => <Checkbox color="default" {...props} />);

export default CheckBoxGroup;
